0441\u043a\u0438\u0439 \u0433\u0435\u043d\u0435\u0440\u0430\u043b, \u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B5%D0%B1%D0%B5%D1%80,_%D0%96%D0%B0%D0%BD-%D0%91%D0%B0%D1%82%D0%B8%D1%81%D1%82\" title=\"\u041a\u043b\u0435\u0431\u0435\u0440, \u0416\u0430\u043d-\u0411\u0430\u0442\u0438\u0441\u0442\">\u0416\u0430\u043d-\u0411\u0430\u0442\u0438\u0441\u0442 \u041a\u043b\u0435\u0431\u0435\u0440<\/a> .<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1807\" class=\"mw-redirect\" title=\"1807\">1807<\/a>&#160;\u2014 \u0440\u0443\u0441\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%A4%D1%80%D0%B8%D0%B4%D0%BB%D0%B0%D0%BD%D0%B4%D0%BE%D0%BC\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0424\u0440\u0438\u0434\u043b\u0430\u043d\u0434\u043e\u043c\">\u0440\u0430\u0437\u0433\u0440\u043e\u043c\u043b\u0435\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u043c<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B4%D0%B8%D0%BD%D1%81%D0%BA\" title=\"\u041f\u0440\u0430\u0432\u0434\u0438\u043d\u0441\u043a\">\u0424\u0440\u0438\u0434\u043b\u0430\u043d\u0434\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1834_%D0%B3%D0%BE%D0%B4\" title=\"1834 \u0433\u043e\u0434\">1834<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A4%D0%B8%D1%88%D0%B5%D1%80,_%D0%98%D1%81%D0%B0%D0%B0%D0%BA&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0424\u0438\u0448\u0435\u0440, \u0418\u0441\u0430\u0430\u043a (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0418\u0441\u0430\u0430\u043a \u0424\u0438\u0448\u0435\u0440 \u043c\u043b.<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D1%80%D0%B8%D0%BD%D0%B3%D1%84%D0%B8%D0%BB%D0%B4_(%D0%92%D0%B5%D1%80%D0%BC%D0%BE%D0%BD%D1%82)\" title=\"\u0421\u043f\u0440\u0438\u043d\u0433\u0444\u0438\u043b\u0434 (\u0412\u0435\u0440\u043c\u043e\u043d\u0442)\">\u0421\u043f\u0440\u0438\u043d\u0433\u0444\u0438\u043b\u0434<\/a>, \u0448\u0442. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%BC%D0%BE%D0%BD%D1%82\" title=\"\u0412\u0435\u0440\u043c\u043e\u043d\u0442\">\u0412\u0435\u0440\u043c\u043e\u043d\u0442<\/a>) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B6%D0%B4%D0%B0%D1%87%D0%BD%D0%B0%D1%8F_%D0%B1%D1%83%D0%BC%D0%B0%D0%B3%D0%B0\" title=\"\u041d\u0430\u0436\u0434\u0430\u0447\u043d\u0430\u044f \u0431\u0443\u043c\u0430\u0433\u0430\">\u043d\u0430\u0436\u0434\u0430\u0447\u043d\u0443\u044e \u0431\u0443\u043c\u0430\u0433\u0443<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838<\/a>&#160;\u2014 \u043d\u0430 \u043f\u0443\u0442\u0438 \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B2%D0%B0%D0%BD%D0%BD%D0%B0_(%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6%D0%B8%D1%8F)\" title=\"\u0421\u0430\u0432\u0430\u043d\u043d\u0430 (\u0414\u0436\u043e\u0440\u0434\u0436\u0438\u044f)\">\u0421\u0430\u0432\u0430\u043d\u043d\u0430<\/a> \u0432 \u043f\u043e\u0440\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%BC%D0%BE%D1%80\" title=\"\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\">\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\u0430<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B5%D0%B3\" title=\"\u0411\u0435\u0440\u0435\u0433\">\u0431\u0435\u0440\u0435\u0433\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D0%B8%D0%BD%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u041a\u0430\u0440\u043e\u043b\u0438\u043d\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u041a\u0430\u0440\u043e\u043b\u0438\u043d\u044b<\/a> \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0438\u0441\u044c \u043f\u0430\u0440\u043e\u0432\u044b\u0435 \u043a\u043e\u0442\u043b\u044b \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043b\u0451\u0441\u043d\u043e\u0433\u043e \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0430 \u00ab\u041f\u044c\u044e\u043b\u0430\u0441\u043a\u0438\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;Pulaski). \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0438\u0441\u0448\u0435\u0441\u0442\u0432\u0438\u044f \u043f\u043e\u0433\u0438\u0431\u043b\u0438 140 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u0438 \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430 \u043a\u043e\u0440\u0430\u0431\u043b\u044f .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1839_%D0%B3%D0%BE%D0%B4\" title=\"1839 \u0433\u043e\u0434\">1839<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B3%D0%B0%D1%82%D0%B0\" title=\"\u0420\u0435\u0433\u0430\u0442\u0430\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0430\u044f \u0440\u0435\u0433\u0430\u0442\u0430<\/a> \u0432 \u0425\u0435\u043d\u043b\u0435\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0439 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0438<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0439\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>. \u0421\u043e\u0431\u044b\u0442\u0438\u044f \u043d\u0430\u0437\u0432\u0430\u043d\u044b \u00ab\u0432\u043e\u0441\u0442\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D0%B8\" title=\"\u0424\u043b\u0430\u0433 \u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0438\">\u041c\u0435\u0434\u0432\u0435\u0436\u0435\u0433\u043e \u0444\u043b\u0430\u0433\u0430<\/a>\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u043f\u043e\