i><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964\" class=\"mw-redirect\" title=\"1964\">1964<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%93%D0%B0%D0%B8%D1%82%D0%B8\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0413\u0430\u0438\u0442\u0438\">\u0413\u0430\u0438\u0442\u0438<\/a> \u0431\u044b\u043b \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d \u0432\u0441\u0435\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B5%D0%B1%D0%B8%D1%81%D1%86%D0%B8%D1%82\" class=\"mw-redirect\" title=\"\u041f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442\">\u043f\u043b\u0435\u0431\u0438\u0441\u0446\u0438\u0442<\/a>. \u041d\u0430 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f\u0445 \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043b\u0438 \u0434\u0435\u043a\u0440\u0435\u0442, \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0430\u044e\u0449\u0438\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0_%D0%94%D1%8E%D0%B2%D0%B0%D0%BB%D1%8C%D0%B5\" class=\"mw-redirect\" title=\"\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0414\u044e\u0432\u0430\u043b\u044c\u0435\">\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0414\u044e\u0432\u0430\u043b\u044c\u0435<\/a> \u043f\u043e\u0436\u0438\u0437\u043d\u0435\u043d\u043d\u044b\u043c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c. \u041d\u0430 \u0432\u043e\u043f\u0440\u043e\u0441 \u00ab\u0421\u043e\u0433\u043b\u0430\u0441\u043d\u044b \u043b\u0438 \u0432\u044b?\u00bb \u0442\u0443\u0442 \u0436\u0435 \u043a\u0440\u0443\u043f\u043d\u044b\u043c\u0438 \u0431\u0443\u043a\u0432\u0430\u043c\u0438 \u0431\u044b\u043b \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d \u043e\u0442\u0432\u0435\u0442 \u00ab\u0414\u0430\u00bb. \u0