e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A-56_(1965)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a-56 (1965) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a-56<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D1%8B%D0%B5_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B8_%D0%BF%D1%80%D0%BE%D0%B5%D0%BA%D1%82%D0%B0_675\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u044b\u0435 \u043b\u043e\u0434\u043a\u0438 \u043f\u0440\u043e\u0435\u043a\u0442\u0430 675\">\u043f\u0440\u043e\u0435\u043a\u0442\u0430 675<\/a> \u0441 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u043c \u0441\u0443\u0434\u043d\u043e\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%90%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D0%BA_%D0%91%D0%B5%D1%80%D0%B3&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u043a \u0411\u0435\u0440\u0433 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u043a \u0411\u0435\u0440\u0433<\/a>\u00bb .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981_%D0%B3%D0%BE%D0%B4\" title=\"1981 \u0433\u043e\u0434\">1981<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-14_%D0%BD%D0%B0_%D0%91%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u043d\u0430 \u0411\u0430\u0439\u043a\u0430\u043b\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u043d\u0430 \u0411\u0430\u0439\u043a\u0430\u043b\u0435<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 48 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B0%D1%82%D0%B0_%D0%BE%D0%B1%D1%89%D0%B8%D0%BD\" title=\"\u041f\u0430\u043b\u0430\u0442\u0430 \u043e\u0431\u0449\u0438\u043d\">\u041f\u0430\u043b\u0430\u0442\u0430 \u043e\u0431\u0449\u0438\u043d<\/a> \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0430 \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u043d\u043e\u0432\u043e\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0431\u0440\u0430\u043a\u0435, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u0435\u0442 \u0441\u0443\u043f\u0440\u0443\u0433\u0430\u043c \u0440\u0430\u0437\u0432\u0435\u0441\u0442\u0438\u0441\u044c \u0447\u0435\u0440\u0435\u0437 \u0433\u043e\u0434 \u043f\u043e\u0441\u043b\u0435 \u0431\u0440\u0430\u043a\u043e\u0441\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BD%D0%B3%D0%B5%D0%BD\" title=\"\u0428\u0435\u043d\u0433\u0435\u043d\">\u0428\u0435\u043d\u0433\u0435\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433<\/a>) \u0431\u044b\u043b \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043c\u0435\u0436\u0434\u0443 \u043f\u044f\u0442\u044c\u044e \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c\u0438, \u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D0%BD%D0%B3%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0428\u0435\u043d\u0433\u0435\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435\">\u0428\u0435\u043d\u0433\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B2%D0%BE%D0%B4%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%A1%D0%B5%D1%80%D0%BE%D0%B2%D0%B5_(1993)\" title=\"\u041d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435 \u0432 \u0421\u0435\u0440\u043e\u0432\u0435 (1993)\">\u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435<\/a> \u043d\u0430 \u0440\u0435\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BA%D0%B2%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u041a\u0430\u043a\u0432\u0430 (\u0440\u0435\u043a\u0430)\">\u041a\u0430\u043a\u0432\u0430<\/a>, \u0432 \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438. \u041d\u0430\u0432\u043e\u0434\u043d\u0435\u043d\u0438\u0435 \u043d\u0430\u043d\u0435\u0441\u043b\u043e \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0439 \u0443\u0449\u0435\u0440\u0431 \u0433\u043e\u0440\u043e\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%80%D0%BE%D0%B2_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u0421\u0435\u0440\u043e\u0432 (\u0433\u043e\u0440\u043e\u0434)\">\u0421\u0435\u0440\u043e\u0432\u0443<\/a>, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u043c\u0443 \u043d\u0430 \u044d\u0442\u043e\u0439 \u0440\u0435\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u0441 \u043e\u0442\u043c\u0435\u043d\u043e\u0439 \u0437\u0430\u043f\u0440\u0435\u0442\u0430 \u043d\u0430 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u0432\u044b\u0441\u043e\u043a\u0438\u0445 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u0444\u0438\u0440\u043c\u0430 \u00abSun Microsystems Computer Company\u00bb \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u0441\u0432\u043e\u0439 \u043e\u0444\u0438\u0441 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u0441\u043b\u0435 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u0431\u0430\u043d\u043a\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979_%D0%B3%D0%BE%D0%B4\" title=\"1979 \u0433\u043e\u0434\">1979 \u0433\u043e\u0434\u0443<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0438 \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0442\u044c\u0441\u044f \u0447\u0430\u0441\u0442\u043d\u044b\u0435 \u0431\u0430\u043d\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 \u0431\u0430\u043d\u0434\u0430, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%81%D0%B0%D0%B5%D0%B2,_%D0%A8%D0%B0%D0%BC%D0%B8%D0%BB%D1%8C_%D0%A1%D0%B0%D0%BB%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0441\u0430\u0435\u0432, \u0428\u0430\u043c\u0438\u043b\u044c \u0421\u0430\u043b\u043c\u0430\u043d\u043e\u0432\u0438\u0447\">\u0428\u0430\u043c\u0438\u043b\u0435\u043c \u0411\u0430\u0441\u0430\u0435\u0432\u044b\u043c<\/a>, \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0430 \u0431\u043e\u043b\u0435\u0435 1600 \u0437\u0430\u043b\u043e\u0436\u043d\u0438\u043a\u043e\u0432 \u0432 \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D1%91%D0%BD%D0%BD%D0%BE%D0%B2%D1%81%D0%BA\" title=\"\u0411\u0443\u0434\u0451\u043d\u043d\u043e\u0432\u0441\u043a\">\u0411\u0443\u0434\u0451\u043d\u043d\u043e\u0432\u0441\u043a<\/a> (\u0441\u043c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D1%80%D0%BE%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BA%D1%82_%D0%B2_%D0%91%D1%83%D0%B4%D1%91%D0%BD%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B5\" class=\"mw-redirect\" title=\"\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0411\u0443\u0434\u0451\u043d\u043d\u043e\u0432\u0441\u043a\u0435\">\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0411\u0443\u0434\u0451\u043d\u043d\u043e\u0432\u0441\u043a\u0435<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1999_%D0%B3%D0%BE%D0%B4\" title=\"1999 \u0433\u043e\u0434\">1999<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D1%8B%D0%B9_%D1%81%D1%83%D0%B4_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u0421\u0428\u0410\">\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u0443\u0434 \u0421\u0428\u0410<\/a> \u043e\u0442\u043c\u0435\u043d\u0438\u043b 65-\u043b\u0435\u0442\u043d\u0438\u0439 \u0437\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0442\u0435\u043b\u0435\u0440\u0435\u043a\u043b\u0430\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B8%D0%BD%D0%BE\" title=\"\u041a\u0430\u0437\u0438\u043d\u043e\">\u043a\u0430\u0437\u0438\u043d\u043e<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0433\u0435\u0442\u043c\u0430\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B3%D0%B0%D0%B9%D0%B4%D0%B0%D1%87%D0%BD%D1%8B%D0%B9,_%D0%9F%D1%91%D1%82%D1%80_%D0%9A%D0%BE%D0%BD%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0430\u0433\u0430\u0439\u0434\u0430\u0447\u043d\u044b\u0439, \u041f\u0451\u0442\u0440 \u041a\u043e\u043d\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421\u0430\u0433\u0430\u0439\u0434\u0430\u0447\u043d\u043e\u043c\u0443<\/a>. \u0414\u0435\u043c\u043e\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d 26 \u0430\u043f\u0440\u0435\u043b\u044f 2014 \u0433\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009_%D0%B3%D0%BE%D0%B4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D1%81%D0%BA\" title=\"\u041c\u0438\u043d\u0441\u043a\">\u041c\u0438\u043d\u0441\u043a\u0435<\/a> \u043f\u0440\u043e\u0448\u0451\u043b 1-\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u044f\">\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439<\/a> \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%94%D0%B5%D0%BD%D1%8C_%D0%BC%D0%BE%D0%BB%D0%BE%D0%BA%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0414\u0435\u043d\u044c \u043c\u043e\u043b\u043e\u043a\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0435\u043d\u044c \u043c\u043e\u043b\u043e\u043a\u0430<\/a>\u00bb .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2014_%D0%B3%D0%BE%D0%B4\" title=\"2014 \u0433\u043e\u0434\">2014<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-76_%D0%B2_%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-76 \u0432 \u041b\u0443\u0433\u0430\u043d\u0441\u043a\u0435\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-76 \u0432 \u041b\u0443\u0433\u0430\u043d\u0441\u043a\u0435<\/a>.<\/li><\/ul><h2>"}